import org.openqa.selenium.JavascriptExecutor;
import org.openqa.selenium.WebDriver;
import org.openqa.selenium.chrome.ChromeDriver;

public class SeperationClass {

	public static void main(String[] args) {

		System.setProperty("webdriver.chrome.driver","E:\\Jars\\ChromeDriver-79\\chromedriver.exe");
		WebDriver driver = new ChromeDriver();
//		driver.manage().deleteAllCookies();
		
	    String baseUrl = "https://stackoverflow.com/questions/32970855/clear-cache-before-running-some-selenium-webdriver-tests-using-java";
	    
	    driver.get(baseUrl);
	    
	    
	    JavascriptExecutor js =(JavascriptExecutor)driver;
	    
	    // get List length returned by getEntries
	    int Counter = Integer.parseInt(js.executeScript("return window.performance.getEntries().length").toString());
	    System.out.println(Counter);
	    System.out.println("*************************************************************************");
	    
	    // Navigation Timings
	    String navigationStatusString = js.executeScript("return window.performance.getEntries()["+1+"]").toString();
	    System.out.println("Navigation : " + navigationStatusString);
	    System.out.println("*************************************************************************");
	    
	    // All Timings
	    for (int i = 0; i < Integer.parseInt(js.executeScript("return window.performance.getEntries().length").toString()); i++) {
	    	String allStatusString = js.executeScript("return window.performance.getEntries()["+i+"]").toString();
		    System.out.println("All Counter"+allStatusString);
		}
	    System.out.println("*************************************************************************");
		
	    // Resource Timings
	    int ResourceCounter = Integer.parseInt(js.executeScript("return window.performance.getEntriesByType('resource').length").toString());
	    System.out.println("Resource Length "+ ResourceCounter);
	    for (int i = 0; i < Integer.parseInt(js.executeScript("return window.performance.getEntriesByType('resource').length").toString()); i++) {
	    	String allStatusString = js.executeScript("return window.performance.getEntriesByType('resource')["+i+"]").toString();
		    System.out.println("All Counter"+allStatusString);
		}
	    System.out.println("*************************************************************************");

	    
	    
	    driver.quit();
		
	}

}

